window.bookSummaryJSON = "<p><b>It's a game of assassin versus assassin. </b> </p> <p>Girton Club-foot has no family and a crippled leg and is apprenticed to the best assassin in the land. </p> <p>He's learning the art of taking lives, but his latest mission tasks him with a far more difficult challenge - to <i>save</i> a life. Someone is trying to kill the heir to the throne, and it is up to Girton to uncover the traitor and prevent the prince's murder. </p> <p><b><i>Age of Assassins</i> is the first in an epic new trilogy set in a world ravaged by magic, featuring a cast of assassins, knights, ambitious noblemen, and fools</b>. </p>"; 
